(1, 'Challenge yourself on championship', 'challenge-yourself-on-championship', 'company-events', '2025-12-19', '17:50', '1233', '4', '<p>Our Championship Course offers a challenging yet rewarding experience for golfers of all skill levels. Designed with strategic bunkers, rolling fairways, and pristine greens, this 18-hole course provides a true test of skill and precision. Featuring breathtaking views and top-tier course conditions, the Championship Course is the perfect setting for competitive play and memorable rounds with friends.</p><h2><strong>Challenge yourself on championship</strong></h2><p>Test your skills on our Championship Course, designed to challenge and inspire golfers of all levels. With strategic bunkers, undulating fairways, and immaculate greens, every round offers a rewarding experience.</p><p><img src=\"https://creativekey.in/wodehouse/images/icon-why-choose-3.svg\" alt=\"\"></p><h3><strong>Strategic bunkers</strong></h3><p>Designed challenge &amp; improve your game.</p><p><img src=\"https://creativekey.in/wodehouse/images/icon-why-choose-1.svg\" alt=\"\"></p><h3><strong>Immaculate Greens</strong></h3><p>Designed challenge &amp; improve your game.</p><p><img src=\"https://creativekey.in/wodehouse/images/icon-why-choose-4.svg\" alt=\"\"></p><h3><strong>Scenic Views</strong></h3><p>Designed challenge &amp; improve your game.</p><p><img src=\"https://creativekey.in/wodehouse/images/icon-why-choose-2.svg\" alt=\"\"></p><h3><strong>Skill Levels</strong></h3><p>Designed challenge &amp; improve your game.</p><p>Take your game to the next level on our Championship Course, meticulously designed to challenge and inspire golfers of all skill levels. This 18-hole course features strategically placed bunkers, rolling fairways, and immaculate greens that demand precision and strategy with every shot. Whether you\'re a seasoned golfer or aiming to improve your game, the Championship Course offers a rewarding test of skill and focus. Surrounded by breathtaking views and maintained to the highest standards, every round is an unforgettable experience.</p>', 'events/1766060491_course-2.jpg', 1, '2025-12-18 12:21:31', '2025-12-19 02:40:33'),
(3, 'Challenge yourself on championship', 'challenge-yourself-on-championship', 'company-events', '2025-12-25', '14:46', '64656', '5 month', '<p>Our Championship Course offers a challenging yet rewarding experience for golfers of all skill levels. Designed with strategic bunkers, rolling fairways, and pristine greens, this 18-hole course provides a true test of skill and precision. Featuring breathtaking views and top-tier course conditions, the Championship Course is the perfect setting for competitive play and memorable rounds with friends.</p><h2><strong>Challenge yourself on championship</strong></h2><p>Test your skills on our Championship Course, designed to challenge and inspire golfers of all levels. With strategic bunkers, undulating fairways, and immaculate greens, every round offers a rewarding experience.</p><p><img src=\"https://creativekey.in/wodehouse/images/icon-why-choose-3.svg\" alt=\"\"></p><h3><strong>Strategic bunkers</strong></h3><p>Designed challenge &amp; improve your game.</p><p><img src=\"https://creativekey.in/wodehouse/images/icon-why-choose-1.svg\" alt=\"\"></p><h3><strong>Immaculate Greens</strong></h3><p>Designed challenge &amp; improve your game.</p><p><img src=\"https://creativekey.in/wodehouse/images/icon-why-choose-4.svg\" alt=\"\"></p><h3><strong>Scenic Views</strong></h3><p>Designed challenge &amp; improve your game.</p><p><img src=\"https://creativekey.in/wodehouse/images/icon-why-choose-2.svg\" alt=\"\"></p><h3><strong>Skill Levels</strong></h3><p>Designed challenge &amp; improve your game.</p><p>Take your game to the next level on our Championship Course, meticulously designed to challenge and inspire golfers of all skill levels. This 18-hole course features strategically placed bunkers, rolling fairways, and immaculate greens that demand precision and strategy with every shot. Whether you\'re a seasoned golfer or aiming to improve your game, the Championship Course offers a rewarding test of skill and focus. Surrounded by brea