(1, 'Wodehouse Courtyard', 'wodehouse-courtyard', 'wodehouse-chambers', '<p>Party under the stars and the moonlight at the Wodehouse Courtyard—a space exclusively designed for those who love being close to nature while celebrating life’s special moments. With its open-air setting and serene ambiance, the courtyard offers a refreshing escape from the city, making it the perfect venue for unforgettable evenings.</p><p>The highlight of this space is its very own outdoor bar counter, thoughtfully designed to keep the cocktails and conversations flowing. Whether it’s an intimate gathering with close friends, a lively social evening, or a private celebration, the Courtyard creates an atmosphere that blends elegance with the charm of the outdoors.</p><p>Surrounded by greenery and open skies, every event here feels magical—be it a starlit dinner, a festive party, or a relaxed sundowner. With the natural beauty of the surroundings enhanced by Wodehouse’s warm hospitality, the Courtyard ensures your celebrations are as memorable as they are unique.</p>', 'facilities/1766063696_1.jpg', 1, '2025-12-18 13:14:56', '2025-12-19 06:19:04'),
(3, 'Wodehouse Gymkhana', 'wodehouse-gymkhana', 'wodehouse-chambers', '<p>Party under the stars and the moonlight at the Wodehouse Courtyard—a space exclusively designed for those who love being close to nature while celebrating life’s special moments. With its open-air setting and serene ambiance, the courtyard offers a refreshing escape from the city, making it the perfect venue for unforgettable evenings.</p><p>The highlight of this space is its very own outdoor bar counter, thoughtfully designed to keep the cocktails and conversations flowing. Whether it’s an intimate gathering with close friends, a lively social evening, or a private celebration, the Courtyard creates an atmosphere that blends elegance with the charm of the outdoors.</p><p>Surrounded by greenery and open skies, every event here feels magical—be it a starlit dinner, a festive party, or a relaxed sundowner. With the natural beauty of the surroundings enhanced by Wodehouse’s warm hospitality, the Courtyard ensures your celebrations are as memorable as they are unique.</p>', 'facilities/1766125768_1.jpg', 1, '2025-12-19 06:29:28', '2025-12-19 06:29:28'),
